import React from 'react';
import colors from '../res/colors';


const listItem = (props) => {
  return (
    <div style={styles}>
      <p>{props.name}</p>
    </div>
  );
};

const styles = {
  backgroundColor: colors.PRIMARY_RED,
  width: '200px',
  padding: '1px',
  margin: '10px'
}


export default listItem;
